// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

pragma experimental ABIEncoderV2;

contract LandRegistration {
    struct User {
        bytes32 fullName;
        bytes32 fatherName;
        bytes32 motherName;
        bytes32 district;
        bytes32 thana;
        uint256 postCode;
        bytes32 village;
        bytes32 email;
        uint256 dob;
        uint256 totalTax;
        string fingerprint;
        bool isExist;
    }

    struct UserOwned {
        uint number;
        bytes32[] khatianList;
    }

    struct Khatian {
        uint64 khatianiId;
        bytes32 plotHash;
        uint16 percentOwn;
        bytes32 buyFrom;
        bytes32[] sellTo;
        uint16[] sellPercentage;
        uint[] ownerArray;
        uint16[] perOwnerPercentage;
        bool isExist;
    }

    struct Plot {
        bytes32 division;
        bytes32 district;
        bytes32 thana;
        uint16 JLNo;
        uint16 plotNo;
        uint8 plotType;
        uint32 plotArea;
        bool isExist;
    }

    mapping(address => User) public userMapping;
    mapping(address => UserOwned) public userOwnedMapping;
    mapping(bytes32 => Khatian) public khatianMapping;
    mapping(bytes32 => Plot) public plotMapping;
    bytes32[] public khatianArray;
    bytes32[] public plotArray;
    uint256 public userCount;

    event CreationOfUser(address indexed userAddress, uint256 indexed userId);
    event CreationOfKhatian(bytes32 indexed khatianHash);
    event CreationOfPlot(bytes32 indexed plotHash);

    modifier userExists() {
        require(userMapping[msg.sender].isExist, "User does not exist");
        _;
    }

    constructor() {
        userCount = 0;
    }

    function createUser() public {
        require(!userMapping[msg.sender].isExist, "User already exists");

        User storage user = userMapping[msg.sender];
        user.fullName = bytes32(0);
        user.fatherName = bytes32(0);
        user.motherName = bytes32(0);
        user.district = bytes32(0);
        user.thana = bytes32(0);
        user.postCode = 0;
        user.village = bytes32(0);
        user.email = bytes32(0);
        user.dob = 0;
        user.totalTax = 0;
        user.fingerprint = "";
        user.isExist = true;

        userCount++;
        emit CreationOfUser(msg.sender, userCount);
    }

    function createKhatian(uint64 khatianiId, bytes32 plotHash) public {
        require(!khatianMapping[plotHash].isExist, "Khatian already exists");

        Khatian storage khatian = khatianMapping[plotHash];
        khatian.khatianiId = khatianiId;
        khatian.plotHash = plotHash;
        khatian.percentOwn = 0;
        khatian.buyFrom = bytes32(0);
        khatian.isExist = true;

        khatianArray.push(plotHash);
        emit CreationOfKhatian(plotHash);
    }

    function createPlot(bytes32 plotHash, bytes32 division, bytes32 district, bytes32 thana, uint16 JLNo, uint16 plotNo, uint8 plotType, uint32 plotArea) public {
        require(!plotMapping[plotHash].isExist, "Plot already exists");

        Plot storage plot = plotMapping[plotHash];
        plot.division = division;
        plot.district = district;
        plot.thana = thana;
        plot.JLNo = JLNo;
        plot.plotNo = plotNo;
        plot.plotType = plotType;
        plot.plotArea = plotArea;
        plot.isExist = true;

        plotArray.push(plotHash);
        emit CreationOfPlot(plotHash);
    }

    function getUserByAddress(address _address) public view returns (User memory) {
        require(userMapping[_address].isExist, "User does not exist");
        return userMapping[_address];
    }

    function getUserOwnedByAddress(address _address) public view returns (UserOwned memory) {
        require(userOwnedMapping[_address].number > 0, "User does not own any khatian");
        return userOwnedMapping[_address];
    }

    function updateUserFullName(address _address, bytes32 fullName) public userExists {
        userMapping[_address].fullName = fullName;
    }

    function updateUserFatherName(address _address, bytes32 fatherName) public userExists {
        userMapping[_address].fatherName = fatherName;
    }

    function updateUserMotherName(address _address, bytes32 motherName) public userExists {
        userMapping[_address].motherName = motherName;
    }

    function updateUserDistrict(address _address, bytes32 district) public userExists {
        userMapping[_address].district = district;
    }

    function updateUserThana(address _address, bytes32 thana) public userExists {
        userMapping[_address].thana = thana;
    }

    function updateUserPostCode(address _address, uint256 postCode) public userExists {
        userMapping[_address].postCode = postCode;
    }

    function updateUserVillage(address _address, bytes32 village) public userExists {
        userMapping[_address].village = village;
    }

    function updateUserEmail(address _address, bytes32 email) public userExists {
        userMapping[_address].email = email;
    }

    function updateUserDOB(address _address, uint256 dob) public userExists {
        userMapping[_address].dob = dob;
    }

    function updateUserTotalTax(address _address, uint256 totalTax) public userExists {
        userMapping[_address].totalTax = totalTax;
    }

    function updateFingerprint(address _address, string memory fingerprint) public userExists {
        userMapping[_address].fingerprint = fingerprint;
    }

    function getKhatianHashById(uint256 id) public view returns (bytes32) {
        require(id > 0 && id <= khatianArray.length, "Invalid Khatian ID");
        return khatianArray[id - 1];
    }

    function getPlotHashById(uint256 id) public view returns (bytes32) {
        require(id > 0 && id <= plotArray.length, "Invalid Plot ID");
        return plotArray[id - 1];
    }

    function getKhatianByHash(bytes32 khatianHash) public view returns (Khatian memory) {
        require(khatianMapping[khatianHash].isExist, "Khatian does not exist");
        return khatianMapping[khatianHash];
    }

    function getPlotByHash(bytes32 plotHash) public view returns (Plot memory) {
        require(plotMapping[plotHash].isExist, "Plot does not exist");
        return plotMapping[plotHash];
    }

    fallback() external payable {}

    receive() external payable {}
}
